import Task from './Task'
import { Divider } from '@material-ui/core';
const Tasks = ({tasks, SetCheckBox}) => {
    return (
        <>
            <Divider/>
            {
                tasks.map((task) =>(
                    <Task key={task.id} task = {task} SetCheckBox = {SetCheckBox}/>
                ))
            }
            <Divider/>
        </>
    )
}

export default Tasks
